description:
Title: Gianna doesn't do small talk
Added: February 26, 2010
Rating: 0.00 (0 votes)
Length: 26 minutes
Website: Can He Score?
Movie: Play
Models in update: Gianna Michaels

This week we brought out one from the archives. It was a shoot that we were not going to put on the air because, well to be honest we messed up the green screen interview in the beginning. But here's the situation, its Gianna! So we mulled it over for a few months and decided that we can't let our fans not see this. They deserve all the Gianna we have and so we pushed this one out. Let me tell you Gianna does not like to waste time. This guy Chris was dryer than a mummy's vagina, no personality and no mind of his own. Finally, She tells him that this isn't going anywhere and instead of just dumping him there at the dinner table she offers a consolation prize...CAN HE SCORE? 

